func Test_countSmaller(t *testing.T) {
	ast := assert.New(t)

	for _, tc := range tcs {
		fmt.Printf("~~%v~~\n", tc)
		ast.Equal(tc.ans, countSmaller(tc.nums), ":%v", tc)
	}
}

func Benchmark_countSmaller(b *testing.B) {
	for i := 0; i < b.N; i++ {
		for _, tc := range tcs {
			countSmaller(tc.nums)
		}
	}
}
